    "preGame": "# üéôÔ∏è TUESDAY NIGHT TROLLBALL PRE-GAME REPORT: BATTLE AT THE BASTION! üèüÔ∏è Hello, hello, hello, fans and fiends! This is your favorite demon of the airwaves, Nok the Corrupter, coming to you live from the misty, jagged heights of **The Old Fort**! We've got a humdinger of a matchup tonight as the flashy **Tortell Privateers** sail inland to face the grim defenders of the **Kerlauger Runeguard**! The fog is so thick you could carve it with a war-scythe, and the footing is about as stable as a goblin on a grease-slide! üå´Ô∏è Speaking of the Privateers, I saw **Keisling Damalas** earlier, and boy, he‚Äôs really leaning into the aesthetic, painting those teeth pitch-black with charcoal! It‚Äôs a terrifying sight, almost as scary as **Lilithe Royce** letting those leeches have a go at her legs to 'lighten the step.' Talk about dedication to the craft! ü©∏ On the home side, the Runeguard are looking stoic as ever among these ancient runes. **Gurney Fadiman** just led a toast of goat‚Äôs milk‚Äîdisgusting stuff, really, give me a flagon of soul-rot any day‚Äîbut it‚Äôs clear they‚Äôre ready to defend this pile of rocks! üêê The crowd is buzzing, despite the 'White Ravens' looming around like a bad omen. Will the Privateers find the gold, or will the Runeguard leave them buried in the dirt? Stay tuned, because the violence is about to begin! üí•",
    "postGame": "# üèÜ POST-GAME WRAP-UP: PRIVATEERS PLUNDER THE FORT! üèÜ What a magnificent display of carnage! Your old pal Nok has never seen such a beautiful mess of broken armor and shattered dreams! The **Tortell Privateers** have pulled off a narrow victory, edging out the **Kerlauger Runeguard** with a final score of **5 to 4**! üè¥‚Äç‚ò†Ô∏è The game started with a bang‚Äîliterally! **Reginauld Cordell** snatched up the ball in the fog, but the highlight of the early half was **Johnna Beetner**, who cut through the defense like a hot knife through butter and dunked that troll head straight into the basket for the first score! üèÄ The violence was top-shelf tonight, folks! **Vivia Namara** was a one-woman wrecking crew, absolutely demolishing **Castorina Gies** and later **Goldberg Tova** with tackles that echoed through the ruins! I haven't seen that much flying dirt since Dame Terra Monteforte's last temper tantrum! üß± The Runeguard held a lead for a while, especially after **Shepperd Trefler** sent a beautiful shot sailing from the Away Field into the goal for two big points! It looked like the home crowd was going to have something to cheer about besides old rocks! üéØ But the Privateers aren't just about flashy capes and charcoal teeth! After **Eugen Zacks** worked some medical magic to get the injured back on the field, the comeback was on! **Melisande Eustacia** found the End Zone for a gritty dunk that turned the tide! üåä The real star of the evening, however, was **Loralee Sunny**! While the defense was busy trying to find their feet in the uneven ruins, Sunny was a bolt of lightning, scoring twice from distance to push the Privateers over the edge! ‚ö°Ô∏è I have to give a shout-out to the brutality in the mud‚Äî**Reginauld Cordell** absolutely flattened **Kidder Starkey**, and **Lon Gabriell** sent **Loralee Sunny** to the sidelines briefly with a tackle that would have made an ogre blush! It‚Äôs that kind of grit that makes Trollball the only sport worth watching in this respawning reality! üíÄ Speaking of 'heroes,' I didn't see much help coming from those White Ravens today. **Colm** might have a cursed handshake, but it didn't help the Runeguard keep hold of the ball! Perhaps they should spend less time reciting legendary names and more time practicing their aim! üê¶ The fans are heading home, some of them probably lost in the fog, but the Tortell Privateers are leaving with the win and a lot of bruised egos left in their wake! It wasn't quite a victory for my beloved **Ebon Gate Corruptors**, but seeing the Runeguard fall in their own fort is the next best thing! üèÅ This is Nok the Corrupter signing off! Remember, if you aren't bleeding, you aren't playing! Goodnight, Osterra! üéôÔ∏èüî•",
