    "preGame": "# üèüÔ∏è TUESDAY NIGHT TROLLBALL: FROSTBITE AND FISTFIGHTS! üèüÔ∏è\n\nHello out there in radioland! This is your favorite demon of the airwaves, **Nok the Corrupter**, coming to you live from the edge of the world! We are hunkered down inside the **South Pole Palisade**, and let me tell you, folks, it is a real ice-box out here! The wind is howling like a pack of starving wolves‚Äîmostly because there *is* a pack of starving wolves howling right outside the log walls! Ha ha! \n\nTonight, we‚Äôve got a real doozy for you. The **South Pole Yetis** are defending their home turf of frozen mud and straw against the visiting **New Monteforte Chaos Creatures**! Now, the Chaos Creatures might be associated with that dirt-wizard Dame Terra Monteforte, but don‚Äôt let their lack of popular support fool you‚Äîthese folks are ready to rumble! I saw **Lian Denton** earlier drinking a shot of hot gravy from a dented tin cup! That‚Äôs the kind of pre-game fuel that leads to broken ribs, and you know I love to see it! üçµüí•\n\nOn the other side of the field, the Yetis are looking chilly but lethal. **Udela Dorkus** was spotted licking a whetstone to sharpen her appetite for destruction, while **Seiter Aida** was getting a good whiff of some game-worn socks. It‚Äôs that kind of rustic charm that really brings the fans out‚Äîwell, the five or six fans who weren't eaten by the local wildlife on the way here! It‚Äôs a shame the **Haven Lights** aren't here to get their teeth kicked in, but we'll make do with these scrappy underdogs! Let‚Äôs get to the action! ‚ùÑÔ∏èü¶¥",
    "postGame": "# üèÜ POST-GAME WRAP-UP: A CHILLING VICTORY! üèÜ\n\n## üßä Final Score: South Pole Yetis 1 - Chaos Creatures 0 üßä\n\nHoly smokes, what a game! If you like your sports cold, muddy, and full of medical emergencies, tonight was your Christmas, Hanukkah, and Solstice all rolled into one! The South Pole Yetis have defended their stockade in a game that was as tight as Sir Tanos's armor after a week of feasting! üçóüõ°Ô∏è\n\nThings started off with a frantic scramble in center field! **Ajit Serge** scooped up that troll head like it was the last scrap of meat in a famine. The Chaos Creatures tried to put the squeeze on early, with **Mouldon Earl** showing some impressive blocking skills against Udela Dorkus. It was a real tug-of-war in the mud, folks, and the violence was just getting warmed up! üí•\n\nWe saw our first trip to the infirmary when **Fogel Raynold** absolutely leveled **Selima Si**! A beautiful tackle that sent Selima straight to the sidelines with an injury. That‚Äôs what we call a 'South Pole Stinger'! But don't you worry about the 'heroes' of the realm‚Äîeven with Imra and Elspeth lurking around the Yetis' locker room, the brutality kept on coming! ü§ï\n\nThe Chaos Creatures had their chances, believe you me! **Raouf Dragone** was charging toward the goal like a bat out of the Demon Prison, but the Yetis' defense held firm. **Sale Tocci** had a bit of a butter-fingers moment, dropping a pass to Coussoule Bidle that could have changed the whole complexion of the first half. It was enough to make a demon weep with joy at the incompetence! üêâ‚ùå\n\nJust before the half-time whistle, the Yetis started playing dirty! **Sale Tocci** redeemed herself by injuring **Alben Diantha**, and then **Udela Dorkus** decided to send **Mouldon Earl** to the healer with a bone-crunching tackle! The Chaos Creatures were looking more like 'Chaos Crumbs' at that point! üçûü¶¥\n\nAfter the break‚Äîwhere I assume everyone just huddled for warmth and prayed to whatever gods haven't abandoned Osterra‚Äîthe blood started flowing again. **Raouf Dragone** came back with a vengeance, taking out **Sale Tocci**! It was a regular revolving door at the healer‚Äôs tent! **Seiter Aida** was working overtime to get those Yetis back on the field. ‚õ∫ü©π\n\n**Fogel Raynold** was a one-man wrecking crew tonight, folks! He sent **Isborne Krause** to the dirt with another injury. Honestly, if Fogel played for my **Ebon Gate Corruptors**, we‚Äôd have the league trophy by now! He was hitting harder than a hangover after an open bar at the Starlight Bazaar! üî®üí•\n\nWe had some missed opportunities that would make a ghost blush! Both **Udela Dorkus** and **Raouf Dragone** tried to play hero with long-distance shots from center field, but they both missed the basket! It‚Äôs harder to aim when your fingers are turning blue and the wind is whistling through the log walls, isn‚Äôt it? üå¨Ô∏èüèÄ\n\nAs the clock ticked down, the tension was higher than High Prince Duke Bar≈ën's wig! **Gabriele Klehm** managed to take out **Udela Dorkus** with a nasty tackle, but it was too little, too late for the New Monteforte squad. They just couldn't find the rhythm, probably because they were too busy listening to **Wolbrom Ariella** sing sea shanties out of tune! üé∂‚öì\n\nThen came the play of the game! **Duky Orelee** grabbed the ball, dodged a few desperate swings, and charged into the End Zone like a man possessed! He **DUNKED** that troll head right into the basket! The crowd‚Äîmostly just a few frostbitten locals and some confused White Ravens‚Äîwent wild! Or at least, they stomped their boots loudly! üèÄüî•\n\nAnd that‚Äôs all she wrote, folks! A 1-0 victory for the **South Pole Yetis**! They might not have the massive following of the **Zmeigorod Snessengers**, but they‚Äôve got grit, they‚Äôve got clubs, and they‚Äôve got a stadium that smells like wet dog and bacon grease! The Chaos Creatures head back to New Monteforte with nothing but bruises and a cold. This is **Nok the Corrupter**, signing off and heading to the nearest fire! Stay brutal, Osterra! üèÅüëπ",
