    "preGame": "### üéôÔ∏è STEP RIGHT UP TO THE BLOODIEST SHOW ON OSTERRA! üéôÔ∏è\n\nHello, sports fans, ghouls, and unfortunate souls trapped in the Everwar! This is Nok the Corrupter, coming to you live from the Prismatic Pavilion, where the air is thick with the scent of salt water and impending trauma! We‚Äôve got a real Tuesday Night humdinger for you as my absolute favorites, the **Ebon Gate Corruptors**, bring their delightful filth to the high-falutin' stilts of the **Starlight Bazaar Bizarres**! Oh, you can just smell the mud and the noxious fumes wafting off our boys from the Ebon Gate, and it smells like victory! ü¶¥üí•\n\nBefore the opening whistle, I took a peek into the locker rooms! The Corruptors are looking sharp; Amedeo Bari was seen polishing his boots with bacon grease‚Äînow that‚Äôs what I call a slick move for a slippery field! Meanwhile, over in the Bizarres‚Äô camp, Gagliano Tallbott was seen telling a terrible joke to the Trollball. I hope that leather head has a sense of humor, because it‚Äôs about to get kicked across the lagoon! \n\nWe‚Äôre perched right over the Starlight Lagoon, folks, and these stage-planks are as unstable as a Warlock‚Äôs promise! Kython and his Prismatic Troupe are everywhere, making a real nuisance of themselves, but don‚Äôt let the bright colors fool you‚Äîthe only thing turning red today will be the floorboards! Let‚Äôs get ready for some beautiful, bone-crunching Trollball! üé™üî•",
    "postGame": "### üèüÔ∏è AN ABSOLUTE CORKER AT THE PAVILION! üèüÔ∏è\n\nWhat a day for the history books, folks! We just witnessed a display of athletic brutality that would make Lord Orzalon himself weep with joy! It was a seesaw battle of brains, brawn, and broken bones right here on the edge of the lagoon. While the crowds might be thin‚Äîhonestly, where is the support for these local icons? Probably busy watching those bores in Zmeigorod‚Äîthe action was thicker than the mud in Ebon Gate! üåäüèí\n\nThings started off with a bang when Amedeo Bari snatched up that beautiful, rotting troll head right in the center field! The Corruptors were moving like a well-oiled machine. Judi Carrington, singing a sea shanty that was mercifully drowned out by the sound of cracking ribs, charged down the field. Despite some early misses, Carrington found the opening and **DUNKS THE BALL**! A beautiful 1-point lead for the good guys! I haven't seen a more satisfying plunge since Sir Tanos fell into that spike pit! üèÜ‚ú®\n\nBut oh, the Bizarres didn't come to play nice! Aggri Cookie‚Äîwhat a name for a monster!‚Äîabsolutely leveled Napoleon Anzovin early on. The sound of that Kirkhammer hitting the planks was music to my ears, even if it meant Napoleon had to take a little nap on the sidelines. Terle Chenay, our lovely healer, had her work cut out for her, belching her way through the revival process to get our boy back in the game! üî®ü§¢\n\nThen came the play of the half! Aggri Cookie, showing a level of focus I usually only reserve for torturing adventurers, lined up a shot from way back in the Away Field. He let it fly, and‚ÄîSwoosh!‚Äîright through the goal for **2 POINTS**! A spectacular 'Shoot' that turned the tide and put the Bizarres in the lead! You won't see that kind of precision from those 'heroes' like Artorias; he‚Äôs too busy admiring his own reflection! üéØüí•\n\nThe violence only escalated from there! Bullion Iglesias, fresh off a silent meditation session, decided to share some peace and quiet with Gagliano Tallbott by knocking him into the next reality! But the Bizarres struck back, with Bush Heiner delivering a tackle on Smith Syst that probably rattled her ancestors. It was a beautiful display of the 'Everwar' spirit‚Äînobody stays down for long, and everyone loses their memory of why they‚Äôre bleeding! ü©∏üòµ\n\nHalftime hit like a cooling breeze, giving everyone a chance to reattach their limbs. But the second half was a defensive masterclass. We saw a flurry of failed tackles as players slipped and slid on the Lagoon-splashed planks. Simsar Carrelli was counting clouds one minute and clutching the ball the next, but the Bizarres' defense was like a wall of glitter and steel. üõ°Ô∏è‚òÅÔ∏è\n\nMilo Nelie showed us the business end of a military fork, sending Bullion Iglesias back to the healer‚Äôs tent. It‚Äôs a crying shame, really! Bullion was just starting to find his rhythm. Then Kristin Kronfeld followed up by injuring Ahasuerus An. The Starlight Bazaar Bizarres were playing like they had something to prove to Kython and the rest of those circus performers! üç¥üí¢\n\nAs the clock ticked down, the desperation was palpable! Amedeo Bari and Ellette Paz were throwing wild passes that went nowhere but the floor‚Äîperhaps the bacon grease on Bari's boots made the ball a bit too slippery? You've got to admire the commitment to the bit! Willa Lois managed to scoop it up for the Bizarres, keeping the pressure on the Corruptors in their own Home Field. üêñüèà\n\nIn the final moments, Bullion Iglesias‚Äîwho had been returned to play by the tireless Terle Chenay‚Äîgot a bit of revenge by absolutely leveling Aggri Cookie! It was a glorious tackle that left the goal-scorer seeing stars that weren't part of the pavilion's decor! But alas, the clock ran out before my beloved Corruptors could capitalize on the chaos. ‚≠êÔ∏èüëä\n\nThe final whistle blows, and it‚Äôs a victory for the home team! The **Starlight Bazaar Bizarres walk away with 2 points** to the **Ebon Gate Corruptors' 1**. A heartbreaking loss for the filthiest team in the league, but what a display of carnage! If you weren't here to see the splinters fly, you missed a classic! üé™üèÅ\n\nSo, as the sun sets over Osterra and the players head off to lose their memories of this glorious beating, remember: Trollball is the only thing that matters in this god-forsaken reality! Don't go following any 'White Ravens' or 'High Princes'‚Äîstay right here for the gore! This is Nok the Corrupter, signing off! Goodnight, and may your armor always be thicker than your skull! üéôÔ∏èüëπ",
