    "preGame": "### üéôÔ∏è WELCOME TO THE HOLLOW MINE, FOLKS! üéôÔ∏è\n\nStep right up and feast your eyes on the most glorious spectacle in all of Osterra! It‚Äôs Tuesday Night Trollball, and boy, do we have a doozy for you! I‚Äôm your host, Nok the Corrupter, coming to you live from the wildflower-covered clearing of Wyrmwood Hollow! Can you feel that humming in the earth, listeners? That‚Äôs not just the Mine Draft‚Äîthat's the raw, unadulterated energy of impending carnage! Our home team, **The Wyrmwood Stronghammers**, are emerging from that ivy-covered mine shaft, and they look ready to crack some skulls for the glory of The Grove! \n\nOn the other side of the pitch, we‚Äôve got the high-rolling, gold-counting visitors, **The New Prosperity Profits**! They‚Äôve traded their velvet-lined counting houses for the mud and blood of the Hollow Mine. I caught a glimpse of their healer, Merissa Mathian, washing her hands with dirt earlier‚Äîa classic ritual to remind her that even the wealthiest merchant ends up in the ground eventually! And keep an eye on Pulchi Benyamin; she was seen devouring dandelions, stem and all, like a woman possessed! They‚Äôve got that backing from the Merchant's Guild, probably hoping Brennan Farno‚Äôs luck rubs off on them, though I suspect that kissless money-priest is too busy counting his copper to care about a few broken ribs!\n\nBut don't count out the Stronghammers! These guys are as rugged as the Mine itself. Ultun Barthelemy spent his warm-ups braiding a teammate‚Äôs nose hair‚Äînow that‚Äôs the kind of team bonding that wins championships! And Autumn Jodoin? He just chugged a raw egg, shell and all! That's the kind of grit that makes a demon‚Äôs heart skip a beat. The crowd is buzzing, the Tangled Vines are twitching, and while they aren't quite my beloved Ebon Gate Corruptors, I expect enough violence to make even Lord Orzalon crack a smile in his cell! Let's get to the action! üõ°Ô∏èü¶¥üí•",
    "postGame": "### üí• FINAL SCORE: PROFITS 2 - STRONGHAMMERS 3 üí•\n\nWhat a magnificently messy affair we witnessed tonight, sports fans! The Wyrmwood Stronghammers have defended their turf in a display of sheer, unbridled brutality that would make any red-blooded demon weep with joy! It was a seesaw of shattered bones and stolen possessions from the very first whistle! \n\nThings got off to a roaring start when Odelia Abbott absolutely leveled Pulchi Benyamin, sending the Profits' star to the dirt early with a sickening crunch! You love to see it! But the Profits weren't about to let that slide. Yoshi Cathy sought immediate vengeance, tackling Odelia right back into the infirmary. It‚Äôs that kind of 'eye for an eye' mentality that keeps the fans coming back, even if Governor-King Zenku would probably hide behind his mask at the sight of such beautiful violence!\n\nJust when the Stronghammers thought they had the momentum, Abramson Doxia stepped up and put Godart Urissa out of commission! The crowd was roaring, the earth was humming, and the stadium was practically vibrating with the thrill of the hunt. Amidst the chaos, Faina Hendrix showed why those merchant-backed suits are so dangerous, launching a spectacular shot from the Home Field to put the Profits up by two points! \n\nBut the Stronghammers are built of sterner stuff than the soft, pampered bankers of New Prosperity. Autumn Jodoin, fueled by that raw egg he ate pre-game, missed his first shot but didn't let that stop him! He scooped that leather head right back up and nailed a shot from the Away Field to tie it up! Talk about a comeback that would leave those fancy Haven Lights crying for their mothers! \n\nHalftime saw Hamburger Marthe and Merissa Mathian working overtime to stitch their players back together. It‚Äôs the Everwar way, folks‚Äîdie, get up, and do it again! The atmosphere in the second half was thick enough to choke a gargoyle, especially with the Mine Draft blowing through the clearing, chilling the players to the bone.\n\nThen came the play of the game! Ultun Barthelemy, with nose hair still impeccably braided, charged through the defense like a runaway cart and dunked that troll head straight into the goal! A touchdown for the ages! The Wyrmwood fans went absolutely wild, nearly drowning out the sound of Faina Hendrix trying to break Cornela Piscatelli in half‚Äîwhich he did, by the way! Another injury for the highlight reel! \n\nGodart Urissa returned to the field with a vengeance, proving that being knocked out only makes you angrier. Godart went on a rampage, injuring Gladdie Farika and then circling back to put Pulchi Benyamin back in the dirt! It was a masterclass in persistence, folks! If only Sir Randy had that kind of aim with his fancy bow, the Wardens might actually get something done for once!\n\nThe Profits tried to orchestrate a late-game miracle, but their coordination fell apart faster than one of Chairman Toland‚Äôs stale biscuits. Passes were dropped, tackles were missed, and Milman Galvan even found time to put Rebane Kendy out of the game just for good measure. The Stronghammers‚Äô defense held firm as the clock ticked down!\n\nIn the end, the Guilder's gold couldn't buy a victory tonight. The Wyrmwood Stronghammers walked away with a 3-2 win, leaving the Profits to lick their wounds and count their losses. I hope Brennan Farno enjoys explaining this deficit to the Guild! \n\nWhat a night! What a game! No heroes here, just winners and the soon-to-be-resurrected losers! This is Nok the Corrupter signing off from Tuesday Night Trollball! Stay vicious, Osterra! üèüÔ∏èüëπüî•",
