    "preGame": "# üéôÔ∏è TUESDAY NIGHT TROLLBALL PRE-GAME SPECTACULAR! \n\nHello there, sports fans, ghouls, and battle-hardened veterans! It's your favorite demon of the airwaves, Nok the Corrupter, coming to you live from the most precarious pile of rocks in Osterra‚ÄîThe Serpent's Pass! üêç Boy oh boy, you can feel the altitude sickness kicking in already, and the fans are absolutely losing their minds! The Zmeigorod Snessengers are the talk of the town, and looking at this crowd, you'd think Valos the Eternal herself was handing out free gold! The Greenwatch has showed up too, though they look a bit out of their element away from their hallowed ground. \n\nSpeaking of ritual, let‚Äôs look at the pre-game prep! Over in the Snessengers' dugout, Delija Dowling just downed a raw egg, shell and all! That‚Äôs what I call a crunchy start! Meanwhile, Evalyn Pierrepont is meticulously polishing a helmet with a live snail. Slow and steady wins the race, or at least makes for a very slimy tackle! \n\nBut don't count out the Greenwatch! Verne Methuselah is currently rubbing the Trollball all over her armpits for that extra 'grip'‚Äîdisgusting, yet effective! And Madea Mensch is hopping around with his bootlaces tied together. It‚Äôs a real circus out here, folks, and we haven't even started the bleeding yet! Sir Randy‚Äôs favorite rangers better watch their step, because this stadium is sinking faster than a lead weight in a bog! Let's get to the action! üõ°Ô∏è‚ö°",
    "postGame": "# üèÜ THE FINAL WHISTLE: A BOG-SOAKED OVERTIME THRILLER! \n\n## üèüÔ∏è The Snessengers Slide to Victory! \n\nHoly smokes, what a humdinger of a match! My voice is practically gone, but my spirit is soaring higher than a harpy! We just witnessed a marathon of carnage that would make Lord Orzalon weep with joy! The Zmeigorod Snessengers have defended their sinking home turf with a 5-4 victory over The Greenwatch in a sudden-death Overtime that had the fans falling out of their seats‚Äîliterally, because of the rockslides! \n\n## ‚öîÔ∏è Early Brutality! \n\nThe game started with a real crack as Evalyn Pierrepont showed the Greenwatch exactly why you don't bring a fancy bow to a Seax fight! She absolutely leveled Darin Berliner early on, sending her straight to the sidelines. Not to be outdone, Pierrepont went back for seconds, flattening Nobe Haukom and leaving the Greenwatch looking like they‚Äôd been run over by a wagon train! \n\n## üèÄ High-Stakes Scoring! \n\nBut the Greenwatch wouldn't stay down! Rese Halpern showed some real gumption, dodging through the mud to dunk the ball right into the goal! It was a beautiful sight, folks‚Äîthe kind of play that makes you forget for a second that these 'heroes' are usually so insufferable. She really showed those Wardens how it's done! \n\n## ü©π The Healers' Heroics! \n\nWaldon Tadeo was working overtime in the Snessengers' pit, patching up Avaria Revell and getting her back into the fray just in time! Nariko Javed for the Greenwatch was no slouch either, wiggling those fingers to bring Darin Berliner back from the brink. It's a miracle anyone is still in one piece with the way Northway Orran was swinging that machete! \n\n## üå©Ô∏è Weathering the Storm! \n\nThe Serpent's Pass lived up to its name, folks! Between the altitude and the sinking field, the players were sliding around like greased pigs. Northway Orran managed a spectacular shot from center field despite the downpour, keeping the score neck-and-neck! You could see the frustration on the faces of the Greenwatch‚Äîprobably wishing they were back under their Scarred Oak! \n\n## ü©∏ Blood on the Grass! \n\nAs we hit the second half, the violence only ramped up! Darin Berliner, seeking revenge, absolutely clobbered Dare Wynnie! Not to be outdone, Drona Jacklin put Kleinstein MacGregor into the dirt. It was a beautiful symphony of groans and clashing steel, a real treat for the senses! \n\n## üèπ The Warden's Resistance! \n\nTroy Jorgan for the Greenwatch managed a spectacular score from center field, momentarily silencing the Zmeigorod faithful. It looked like the 'heroes' might actually pull it off! I almost felt a tinge of disappointment, but then I remembered my favorite team wasn't playing, so I just settled in for more mayhem! \n\n## üïí Overtime Madness! \n\nWhen the clock ran out at 4-4, we headed into Overtime! The tension was thicker than the swamp gas! Both teams were exhausted, breaths hitching in the thin air. The fans were chanting so loud you could barely hear the bones snapping! \n\n## üî± The Winning Dunk! \n\nFinally, the moment of truth! Arni Griffith, who had been giving the Trollball a heroic backstory all afternoon, finally became the hero of his own tale! He broke through the Greenwatch defense and slammed that leather head into the goal for the win! The crowd erupted like a volcano! \n\n## üèÅ Final Thoughts! \n\nFinal score: Zmeigorod Snessengers 5, The Greenwatch 4! What a night for the bog-dwellers! Sir Randy and his Rangers are going home with bruised egos and even bruisier shins. Valos the Eternal must be cackling in her bog tonight! This is Nok the Corrupter signing off‚Äîkeep your weapons sharp and your healers close! See you next Tuesday! üé§üëπ",
